eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   almereDuinKreekbosZuidAanDeKreekFase1: () => (/* binding */ almereDuinKreekbosZuidAanDeKreekFase1)\n/* harmony export */ });\nconst almereDuinKreekbosZuidAanDeKreekFase1 = {\n    slug: \"almere-duin-kreekbos-zuid-aan-de-kreek-fase-1\",\n    title: \"Almere Duin  kavels in het Kreekbos\",\n    subtitle: \"Kreekbos Zuid (Aan de Kreek fase 1): een voltooide, gewilde boswijk waar architectuur bewust ondergeschikt is aan het landschap. Met kavelpaspoorten, monolithische vormen en strikte materialisering ontstond een uitzonderlijke harmonie tussen wonen, bomen en open plekken in het Muiderbos.\",\n    locationLabel: 'Locatie: Almere Duin, Kreekbos Zuid (\"Aan de Kreek\" fase 1)',\n    tags: [\n        \"Almere Duin\",\n        \"Kreekbos Zuid\",\n        \"Aan de Kreek\",\n        \"Kavels\",\n        \"Boswonen\",\n        \"Muiderbos\",\n        \"Kavelpaspoort\",\n        \"Monolithische architectuur\",\n        \"Ingetogen vormtaal\",\n        \"Eenduidig materiaalgebruik\",\n        \"Duurzaam wonen\",\n        \"Natuur-inclusief\",\n        \"Open plekken in bos\",\n        \"BVO max 300m\",\n        \"Woonomgeving als landschap\"\n    ],\n    categories: [\n        \"kavels\",\n        \"gebiedsontwikkeling\",\n        \"inspiratie\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Almere Duin  Aan de Kreek (Kreekbos Zuid) | Kavels & boswonen | Zwijsen.net\",\n        description: \"Aan de Kreek in Almere Duin (Kreekbos Zuid): 30 exclusieve kavels in het Muiderbos. Kavelpaspoorten sturen op ingetogen monolithische architectuur en eenduidige materialisering voor boswonen in harmonie met natuur.\",\n        keywords: [\n            \"Almere Duin kavels\",\n            \"Aan de Kreek fase 1\",\n            \"Kreekbos Zuid boswonen\",\n            \"Muiderbos kavelpaspoort\",\n            \"monolithische architectuur bos\",\n            \"architect Almere Duin\",\n            \"kavelpaspoort eisen\",\n            \"BVO 300m2\",\n            \"bescheiden architectuur natuur\",\n            \"duurzaam wonen in het bos\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-architect-beton-monolithisch-boswonen-almere-duin.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-architect-beton-monolithisch-boswonen-almere-duin.jpg\",\n        alt: \"Monolithische bosvilla-impressie in Almere Duin: ingetogen volumes en eenduidig materiaalgebruik tussen bestaande bomen.\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-architect-beton-monolithisch-boswonen-almere-duin.jpg\",\n            alt: \"Almere Duin boswonen: monolithische villa tussen bomen, gericht op rust en integratie in het Muiderbos.\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/kubistische-architectuur-villa-ontwerp-gelaagd-terras-bosperceel.jpg\",\n            alt: \"Kubistische bosvilla met gelaagd terras: ingetogen volumes, subtiele verschuivingen en sterke binnen-buiten relatie.\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Kavels in het Kreekbos: architectuur en natuur in harmonie\",\n            content: 'Kreekbos Zuid, beter bekend als het plan \"Aan de Kreek\", is een unieke en inmiddels voltooide ontwikkeling binnen Almere Duin. Wat begon met de verkoop van 30 exclusieve kavels groeide uit tot een landschappelijk en architectonisch voorbeeldproject.\\n\\nDe kavels liggen in het oorspronkelijke Muiderbos. Door strategisch open plekken te maken konden bijzondere, individuele woningen ontstaan znder het bos te domineren. Bewoners wonen er op korte afstand van het strand en letterlijk tussen en onder bestaande bomen.\\n\\nDe ambitie was vanaf het begin helder: een harmonieuze en bescheiden woonomgeving creren waarin de natuur de onbetwiste hoofdrol speelt.',\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2020/10/architekt-kavel-almere-kreekbos-bouwgrond-duin-1.jpg\",\n                alt: \"Aan de Kreek Almere Duin: kavels in het Kreekbos met bosstructuur en open plekken voor individuele woningen.\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"Almere Duin  Kavels in het Kreekbos\",\n            values: [\n                \"Architectuur ondergeschikt aan landschap\",\n                \"Boswonen als centraal thema\",\n                \"Strakke kaders die kwaliteit afdwingen\",\n                \"Monolithische, ingetogen vormtaal\",\n                \"Eenduidig kleur- en materiaalgebruik\",\n                \"Wijk als voltooide, gewilde oase\"\n            ],\n            roleItems: [\n                \"Gebiedsvisie: woonomgeving als landschap, natuur leidend\",\n                \"Sturing: per kavel een Kavelpaspoort als onwrikbare basis\",\n                \"Randvoorwaarden: BVO max. 300 m, ingetogen volumes\",\n                \"Beeldkwaliteit: monolithisch uiterlijk, weinig drukke details\",\n                \"Materialisering: n dominant materiaal/kleur als rustige entiteit\",\n                \"Binnen-buiten: grote raampartijen en subtiele volumeschuivingen\",\n                \"Resultaat: blauwdruk voor toekomstige bos- en natuurgerichte ontwikkelingen\"\n            ],\n            partners: [\n                {\n                    label: \"Locatie\",\n                    value: 'Almere Duin  Kreekbos Zuid (\"Aan de Kreek\" fase 1)'\n                },\n                {\n                    label: \"Karakter\",\n                    value: \"Boswonen met strikte beeldkwaliteitskaders\"\n                },\n                {\n                    label: \"Kaderdocument\",\n                    value: \"Kavelpaspoort per kavel (voorwaarden en eisen)\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"De basis van het ontwerp: het kavelpaspoort\",\n            content: \"In tegenstelling tot veel nieuwbouwprojecten, waar ontwerpvrijheid centraal staat, was hier een sturend uitgangspunt: de architectuur is ondergeschikt aan het landschap n aan de totale woonomgeving.\\n\\nOm die visie te borgen is voor elke kaveleigenaar een Kavelpaspoort opgesteld. Dit document was de onwrikbare basis voor alle schetsontwerpen en latere bouwactiviteiten en bundelde voorwaarden en eisen die allemaal in het teken stonden van n thema: boswonen.\\n\\nJuist doordat de spelregels helder waren, ontstond ruimte voor kwaliteit, rust en een wijk die als geheel klopt.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2020/10/Kavelkaart_Aan_de_Kreek_Oktober_2020_resize.jpg\",\n                alt: \"Kavelkaart Aan de Kreek: structuur van open plekken in het bos en verdeling van kavels binnen Kreekbos Zuid.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Monolithische architectuur: ingetogen en eenduidig\",\n            content: \"De architectonische eisen waren gericht op het minimaliseren van de visuele impact van bebouwing in een bosrijke omgeving. Woningen mochten maximaal 300 m BVO hebben en moesten een beeld uitstralen van bescheiden, ingetogen vormen.\\n\\nDaarbij hoorde een eis voor eenduidig kleur- en materiaalgebruik. Het resultaat is een wijkbeeld waarin gebouwen als n solide, uit de grond gegroeide entiteit worden ervaren: monolithisch.\\n\\nDie rust ontstaat vaak door n dominant materiaal of kleur (bijvoorbeeld donker hout of aardse tinten) voor gevels en soms zelfs daken. Variatie zit niet in uitbundige details, maar in subtiele verschuivingen van sobere volumes en de wisselwerking tussen binnen en buiten door grote raampartijen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/tijdloze-architectuur-beton-villa-vrijstaand-winter-design-woning.jpg\",\n                alt: \"Monolithische bosvilla: sober volume, eenduidige materialisering en een rustige, tijdloze uitstraling in winterse setting.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-architect-beton-monolithisch-boswonen-almere-duin.jpg\",\n                    alt: \"Monolithische bosvilla: ingetogen volumes en eenduidige materialisering.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/kubistische-architectuur-villa-ontwerp-gelaagd-terras-bosperceel.jpg\",\n                    alt: \"Kubistische villa met gelaagde terrassen: subtiele volumewerking in het bos.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-villa-architect-glaspuien-avondzicht-natuur-harmonie-ontwerp.jpg\",\n                    alt: \"Avondbeeld: grote glaspuien en harmonie tussen woning en bosomgeving.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-houten-balken-boszicht.jpg\",\n                    alt: \"Interieur met houten balken en zicht op het bos: natuur als decor.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2020/10/Almere-duin-kavel-architekt-bouwgrond-aan-de-kreek.jpg\",\n                    alt: \"Kavelcontext Aan de Kreek: ligging in bosstructuur met heldere regels voor boswonen.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2020/10/Kavelkaart_Aan_de_Kreek_Oktober_2020_resize.jpg\",\n                    alt: \"Kavelkaart: opzet van het plan Aan de Kreek in Kreekbos Zuid.\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Interieur als verlengstuk van de bosbeleving\",\n            content: \"Binnen wordt de boservaring versterkt door grote openingen en een heldere relatie met het perceel. Constructieve elementen in hout en zicht op de verticale ritmiek van de bomen maken de natuur onderdeel van het dagelijks wonen.\\n\\nDe kracht van het plan is dat iedere woning individueel is, maar het totaalbeeld consequent rustig blijft. Daardoor voelt Aan de Kreek als n samenhangende, natuurlijke leefomgeving.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieurontwerp-bosbeleving-houten-constructie-grote-ramen-architectuur.jpg\",\n                alt: \"Interieurontwerp met houten constructie en grote ramen: bosbeleving en daglicht als integraal onderdeel van het wonen.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Een gewilde en voltooide oase\",\n            content: \"De combinatie van strikte, maar tegelijk inspirerende uitgangspunten heeft geleid tot een resultaat dat uniek is in Almere en de regio. Aan de Kreek is een gewilde, voltooide oase waar natuur en doordachte, bescheiden architectuur hand in hand gaan.\\n\\nHet plan laat zien dat beperkende voorwaarden juist kunnen leiden tot de meest creatieve en succesvolle ontwerpen. Kaveleigenaren, architecten en gemeente hebben samen een woonwijk gerealiseerd die de essentie van duurzaam wonen in een natuurlijke setting overtuigend belichaamt.\\n\\nDe focus op behoud van het Muiderbos en de integratie van woningen daarin is bovendien een blauwdruk geworden voor toekomstige bos- en natuurgerichte ontwikkelingen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2022/10/Almere-kavel-kreekbos-duin-1-4.jpg\",\n                alt: \"Aan de Kreek Almere Duin: wonen tussen bomen met open plekken en bosstructuur als leidend ontwerpprincipe.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Maak kennis met onze aanpak en ontdek wat we voor uw woonplannen kunnen betekenen. U zit nergens aan vast.\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/almere-duin-kreekbos-zuid-aan-de-kreek-fase-1.ts\n");

