eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   hofwoningCronenburghLoenen: () => (/* binding */ hofwoningCronenburghLoenen)\n/* harmony export */ });\nconst hofwoningCronenburghLoenen = {\n    slug: \"architect-loenen-aan-de-vecht-hofwoning-cronenburgh\",\n    title: \"Hofwoning Cronenburgh\",\n    subtitle: \"Hofwoning-special in Cronenburgh: lage nokhoogte vertaald naar een gelaagde woning met drie vleugels, houten spanten en een beschut binnenhof\",\n    locationLabel: \"Locatie: Loenen aan de Vecht\",\n    tags: [\n        \"Nieuwbouw\",\n        \"Hofwoning\",\n        \"Cronenburgh\",\n        \"Special woning\",\n        \"Lage nokhoogte\",\n        \"Houten spanten\",\n        \"Binnenhof\",\n        \"Ruwe baksteen\",\n        \"Zinken dakkapellen\",\n        \"Drie vleugels\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Hofwoning Cronenburgh Loenen aan de Vecht | Architect Jules Zwijsen\",\n        description: \"Hofwoning-special in Cronenburgh met lage nokhoogte, drie vleugels, houten spanten, ruwe baksteen en beschut binnenhof in Loenen aan de Vecht.\",\n        keywords: [\n            \"hofwoning Cronenburgh\",\n            \"special woning Cronenburgh\",\n            \"nieuwbouw Loenen aan de Vecht\",\n            \"lage nokhoogte\",\n            \"houten spanten woning\",\n            \"ruwe baksteen gevel\",\n            \"zinken dakkapellen\",\n            \"binnenhof woning\",\n            \"drie vleugels\",\n            \"gelaagde woning\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/nieuwbouw-stedelijke-woningen-baksteen-architectuur-straatbeeld.webp\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/nieuwbouw-stedelijke-woningen-baksteen-architectuur-straatbeeld.webp\",\n        alt: \"Architect Loenen aan de Vecht: hofwoning Cronenburgh met lage kap, ruwe baksteen en uitgesproken geleding\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/nieuwbouw-stedelijke-woningen-baksteen-architectuur-straatbeeld-cronenburg-architekt.webp\",\n            alt: \"Hofwoning-special in Cronenburgh die afwijkt in hoogte en lengte van omliggende nieuwbouw\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/woonkeuken-onder-kap-houten-spanten-interieur.webp\",\n            alt: \"Poort naar het binnenhof met licht pleisterwerk en grote raampartijen\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/binnenhof-stedelijk-woningensemble-patio-buitenruimte-villa-hoevewoning.webp\",\n            alt: \"Exterieur hofwoning Cronenburgh met lage kap en karakteristieke geleding\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"De hofwoning-special: lage nokhoogte als ontwerpkwaliteit\",\n            content: \"De hofwoning is n van de specials in het plan Cronenburgh in Loenen aan de Vecht. Binnen een wijk met overwegend reguliere nieuwbouwwoningen is dit huis bewust afwijkend in hoogte en lengte.\\n\\nDe beperking van de lage nokhoogte uit het bestemmingsplan is niet benaderd als belemmering, maar als een ontwerpkwaliteit. Door een reeks zorgvuldig gekozen hoogteverschillen ontstaat een gelaagde woning met drie vleugels, elk met een eigen doorsnede.\\n\\nDie verschillen zijn aan de buitenzijde afleesbaar en geven de hofwoning een karakteristiek silhouet dat zich onderscheidt in het straatbeeld.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/daklandschap-nieuwbouw-woningen-kapritme.webp\",\n                alt: \"Hofwoning Cronenburgh met drie vleugels en varirende kapvormen als afleesbare doorsnedes\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"De opdrachtgever zocht een bijzondere nieuwbouwwoning in Cronenburgh, Loenen aan de Vecht  n van de 'specials' binnen het plan. De kavel kent een lage toegestane nokhoogte volgens het bestemmingsplan. De opgave was om deze beperking te vertalen naar een ontwerpkwaliteit: een woning met karakter en identiteit die zich onderscheidt van de omliggende reguliere nieuwbouw, zonder concessies te doen aan ruimtelijkheid en woongenot.\",\n            values: [\n                \"Lage nokhoogte als ontwerpkwaliteit\",\n                \"Gelaagde woning met drie vleugels\",\n                \"Verschillende doorsnedes per vleugel\",\n                \"Houten spanten als structuur en sfeer\",\n                \"Ruwe baksteen met rustieke uitstraling\",\n                \"Zinken dakkapellen\",\n                \"Binnenhof met licht pleisterwerk\",\n                \"Privacy en daglicht in balans\"\n            ],\n            roleItems: [\n                \"Stedenbouwkundig: special woning binnen Cronenburgh\",\n                \"Ruimtelijk concept: drie vleugels met verschillende hoogtes en functies\",\n                \"Constructie: houten spanten in het zicht als ritme en sfeerdrager\",\n                \"Materialisatie: ruwe baksteen straatzijde, licht pleisterwerk binnenhof\",\n                \"Interieur: varirende verdiepingshoogtes en lange zichtlijnen\",\n                \"Buitenruimte: beschut binnenhof met poort\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Drie vleugels, drie woonwerelden\",\n            content: \"De drie vleugels zijn ontworpen als drie verschillende woonwerelden die samen n hofwoning vormen. Een vleugel met een relatief lage berging op de begane grond maakt ruime slaapkamers op de verdieping mogelijk.\\n\\nEen tweede vleugel bevat een verdiept gelegen slaapkamer met directe toegang tot de tuin; boven deze zone ligt een eetkeuken die verhoogd is ten opzichte van de stoep. Die verhoging geeft extra privacy en benut de zichtlijnen optimaal, mede door de ligging op een kruising van straten.\\n\\nDe derde vleugel biedt een royale woonkamer met daarboven een 'zwevende' verdieping waarin een knusse tv-kamer is opgenomen. Deze opbouw zorgt voor variatie, ruimtelijkheid en logische zonering binnen de woning.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/kapconstructie-interieur-villa-hoevewoning-loenen.webp\",\n                alt: \"Verhoogde eetkeuken met privacy en zichtlijnen door ligging op kruising in Cronenburgh\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Houten spanten als ruimtelijke drager in het interieur\",\n            content: \"De kapvorm wordt aan de binnenzijde versterkt door in het zicht blijvende houten spanten die de draagconstructie vormen. Deze spanten verwijzen naar oude hoevewoningen, maar zijn op een moderne manier ingezet: als structuur, ritme en sfeerdrager tegelijk.\\n\\nIn combinatie met verschillende verdiepingshoogtes en vloerniveaus ontstaat een divers en gelaagd interieur met lange zichtlijnen in de woning en gerichte doorzichten naar de tuin en de omgeving.\\n\\nDe hofwoning voelt daardoor ruim, terwijl de verschillende zones toch intiem en passend blijven. Het is een voorbeeld van hoe karakter kan ontstaan met constructie en ruimte, zonder decoratie.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-routing-trap-daglicht-houten-kap.webp\",\n                alt: \"Houten spanten in zicht benadrukken de kapvorm en geven ritme aan het interieur\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Ruwe baksteen en zinken dakkapellen: stoer en rustiek, maar modern gedetailleerd\",\n            content: \"De buitenzijde is uitgevoerd in een zeer ruwe, soms subtiel vervormde baksteen, met grote uitgemetselde vensterbanken en dakkapellen in zink. De stoere textuur verwijst naar historische kasteel- of kloostermuren, waardoor de relatief lage woning toch een krachtige uitstraling krijgt binnen het geheel van Cronenburgh.\\n\\nTegelijk is de detaillering eigentijds: precies, helder en terughoudend. Zo ontstaat een rustieke uitstraling die niet nostalgisch wordt, maar modern blijft in maatvoering en afwerking.\\n\\nDit project is een goed voorbeeld van hoe materiaalkeuze een woning karakter geeft n de schaal in het straatbeeld kan sturen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/hoevewoning-loenen-10.jpg\",\n                alt: \"Ruwe baksteen met uitgemetselde vensterbanken en zinken dakkapellen bij hofwoning Cronenburgh\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/hoevewoning-loenen-05.jpg\",\n                    alt: \"Exterieur hofwoning Cronenburgh met lage kap\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/binnenhof-stedelijk-woningensemble-patio-buitenruimte.webp\",\n                    alt: \"Hofwoning in straatbeeld Cronenburgh\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/daglicht-dakopeningen-interieur-villa.webp\",\n                    alt: \"Drie vleugels met varirende kapvormen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-villa-cronenburgh-houten-constructie-nieuwbouw-villa-loenen.webp\",\n                    alt: \"Detail ruwe baksteen en zinken dakkapellen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-villa-cronenburgh-houten-constructie-verbouw.webp\",\n                    alt: \"Interieur met houten spanten\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/woonkeuken-onder-kap-houten-spanten-interieur.webp\",\n                    alt: \"Eetkeuken met zichtlijnen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/hoevewoning-loenen-03.jpg\",\n                    alt: \"Binnenhof met licht pleisterwerk\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/hoevewoning-loenen-11.jpg\",\n                    alt: \"Poort naar binnenhof\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Het binnenhof: licht, beschut en ruimtelijk\",\n            content: \"Het binnenhof vormt het rustige hart van de hofwoning en is bereikbaar via een poort. Aan deze meer beschutte zijde verandert de materialisatie: licht pleisterwerk en grote raampartijen brengen daglicht diep in de woning en maken het hof ruimtelijk en vriendelijk.\\n\\nHierdoor ontstaat een duidelijke tweedeling: een stoere, robuuste buitenkant aan de straat en een lichte, open wereld aan het hof. Die combinatie maakt de woning tegelijk stevig en uitnodigend.\\n\\nHet binnenhof laat zien hoe privacy, daglicht en buitenruimte kunnen worden georganiseerd binnen de beperkingen van een bestemmingsplan en de schaal van een nieuwbouwwijk.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/binnenhof-stedelijk-woningensemble-patio-buitenruimte.webp\",\n                alt: \"Binnenhof met licht pleisterwerk en grote raampartijen voor daglicht en beschutting\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Wilt u een woning ontwerpen die beperkingen omzet in karakter en ruimte maakt voor het dagelijks leven?\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-hofwoning-cronenburgh.ts\n");

