eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   knikhuisCronenburghLoenen: () => (/* binding */ knikhuisCronenburghLoenen)\n/* harmony export */ });\nconst knikhuisCronenburghLoenen = {\n    slug: \"architect-loenen-aan-de-vecht-knikhuis-cronenburgh\",\n    title: \"Knikhuis Cronenburgh\",\n    subtitle: \"Een markant knikhuis als stedenbouwkundige special op het Cronenburgherplein in Loenen aan de Vecht\",\n    locationLabel: \"Locatie: Loenen aan de Vecht\",\n    tags: [\n        \"Nieuwbouw\",\n        \"Knikhuis\",\n        \"Cronenburgh\",\n        \"Stedenbouwkundig accent\",\n        \"Abstracte architectuur\",\n        \"Verdraaide kap\",\n        \"Zichtlijnen\",\n        \"Special woning\",\n        \"Garage schuur\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Knikhuis Cronenburgh Loenen aan de Vecht | Architect Jules Zwijsen\",\n        description: \"Knikhuis als stedenbouwkundige special in Cronenburgh op het Cronenburgherplein, met verdraaide kap, abstracte gevels en sterke zichtlijnen.\",\n        keywords: [\n            \"knikhuis Cronenburgh\",\n            \"special woning Cronenburgh\",\n            \"nieuwbouw Loenen aan de Vecht\",\n            \"Cronenburgherplein\",\n            \"abstracte architectuur\",\n            \"verdraaide kap\",\n            \"woning op kruising\",\n            \"zichtlijnen woning\",\n            \"stedenbouwkundig accent\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1560_resize.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1560_resize.jpg\",\n        alt: \"Knikhuis Cronenburgh  stedenbouwkundige special met verdraaide kap\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_2759_resize.jpg\",\n            alt: \"Exterieur knikhuis als markant accent aan het Cronenburgherplein\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_4004_resize.jpg\",\n            alt: \"Knikhuis op overgang Lutgerslaan naar Cronenburgherplein\"\n        },\n        {\n            url: \"hhttps://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1931_resize.jpg\",\n            alt: \"Detail abstracte gevel knikhuis met verdraaide kap\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Het Knikhuis als Stedenbouwkundige Special\",\n            content: \"Net als de torenwoning is ook kavel 11 n van de specials binnen het plan Cronenburgh in Loenen aan de Vecht. De woning is gesitueerd op de plek waar de Lutgerslaan overgaat in het Cronenburgherplein en markeert daar de verdraaiing van de stratenstructuur.\\n\\nDeze verdraaiing is het uitgangspunt geworden voor de vormgeving van het knikhuis. Door het knikpunt van de woning bewust te verplaatsen, wordt de hirarchie van de openbare ruimte versterkt: het grootste deel van de gevel richt zich nadrukkelijk op het Cronenburgherplein.\\n\\nDit project laat zien hoe stedenbouwkundige kenmerken direct kunnen worden vertaald naar architectuur.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1275_resize.jpg\",\n                alt: \"Knikhuis Cronenburgh dat de verdraaiing van straten accentueert\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"De opdrachtgever zocht een bijzondere nieuwbouwwoning op kavel 11 in Cronenburgh, n van de stedenbouwkundige specials binnen het plan. De kavel ligt op de overgang van de Lutgerslaan naar het Cronenburgherplein, waar de stratenstructuur verdraait. De opgave was om deze stedenbouwkundige verdraaiing te vertalen naar een architectonisch statement dat het plein markeert en versterkt.\",\n            values: [\n                \"Stedenbouwkundige special\",\n                \"Verdraaiing stratenstructuur als uitgangspunt\",\n                \"Markering Cronenburgherplein\",\n                \"Abstracte architectuur\",\n                \"Sculpturaal volume\",\n                \"Zichtlijnen als organiserend principe\",\n                \"Privacy en daglicht in balans\",\n                \"Garage als schuurinterpretatie\"\n            ],\n            roleItems: [\n                \"Stedenbouwkundig: positionering op kruispunt van straten\",\n                \"Ruimtelijk concept: knikhuis met verdraaide kap\",\n                \"Gevelcompositie: abstracte gevels met strategische sparingen\",\n                \"Interieur: zichtlijnen als organiserend principe\",\n                \"Materialisatie: massief volume met strak gedetailleerde openingen\",\n                \"Bijgebouw: garage met verwijzing naar lokale schuurarchitectuur\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Verdraaide Kap en Abstracte Gevelcompositie\",\n            content: \"De nok van de woning volgt niet de rooilijn van de kavel, maar juist de middellijn tussen de twee hoeken van de straat. Hierdoor verloopt de goothoogte en wordt de verdraaiing van de straatstructuur nogmaals benadrukt.\\n\\nDoor kozijnen strak in de gevels te plaatsen en de detaillering bewust eenvoudig te houden, krijgt de woning een abstract karakter. Het knikhuis leest zich als een massief volume  bijna als een stenen diamant  waarin zorgvuldig geplaatste sparingen het interieur zichtbaar maken en voorzien van daglicht en uitzicht.\\n\\nDeze abstractie versterkt de sculpturale kwaliteit van de woning en verankert haar stevig in de omgeving.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_0549_resize.jpg\",\n                alt: \"Abstracte gevel knikhuis met strak geplaatste kozijnen en verdraaide kap\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: true,\n            title: \"Zichtlijnen als Organiserend Principe in het Interieur\",\n            content: \"Het interieur van de woning wordt georganiseerd rond twee duidelijke insnedes. De eerste insnede vormt het verlengde van de Zegelaarweg en benadrukt deze lange zichtlijn diep in de woning. De tweede insnede komt voort uit de positie van de entree en de interne ontsluiting.\\n\\nDoor de trappen strategisch te plaatsen, wordt de zichtlijn richting de diepe tuin achter de woning versterkt. Deze ruimtelijke sneden zijn aan de buitenzijde afleesbaar door een afwijkende materialisering en detaillering van de gevel en vormen samen n geheel met de uitbouw op de begane grond.\\n\\nDit is een schoolvoorbeeld van hoe interieur en exterieur elkaar wederzijds versterken.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1094_resize.jpg\",\n                alt: \"Zichtlijnen en insnedes in interieur knikhuis richting tuin\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1595_resize.jpg\",\n                    alt: \"Exterieur knikhuis Cronenburgh aan plein\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1103_resize.jpg\",\n                    alt: \"Abstracte gevel met verdraaide kap\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1592_resize.jpg\",\n                    alt: \"Zichtlijnen en insnedes in gevel\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_4006_resize.jpg\",\n                    alt: \"Detail gevelopeningen en materialisatie\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_0544_resize.jpg\",\n                    alt: \"Knikhuis op overgang straten\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_4000_resize.jpg\",\n                    alt: \"Stedenbouwkundig accent Cronenburgherplein\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Daglicht, Privacy en Gericht Uitzicht\",\n            content: \"Door strategisch geplaatste gevelopeningen is de woning rijk voorzien van daglicht, terwijl privacy behouden blijft ten opzichte van de openbare ruimte. De openingen zijn niet willekeurig geplaatst, maar zorgvuldig afgestemd op zichtlijnen, functies en orintatie.\\n\\nOp de juiste plekken ontstaat uitzicht op het Cronenburgherplein, de omliggende straten en de diepe tuin. Deze balans tussen openheid en beschutting is essentieel voor comfortabel wonen op een zichtlocatie en laat zien hoe complexe stedelijke situaties kunnen worden opgelost.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_1560_resize.jpg\",\n                alt: \"Strategisch geplaatste gevelopeningen voor daglicht en privacy\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Garage als Hedendaagse Interpretatie van de Schuur\",\n            content: \"Achter in de tuin is een vrijstaande garage geplaatst die qua vorm en materialisatie refereert aan de oude schuren die in de omgeving veel voorkomen. De gevel is bekleed met zwart geteerde, gepotdekselde houten delen, aangebracht op een helder stramien van houten spanten.\\n\\nHiermee vormt de garage een ingetogen maar karaktervolle tegenhanger van het abstracte hoofdvolume. Samen versterken woning en bijgebouw het verhaal van de plek: een eigentijdse woning die diep geworteld is in de context van Loenen aan de Vecht en Cronenburgh.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_4000_resize.jpg\",\n                alt: \"Garage in tuin met zwart geteerd hout als verwijzing naar oude schuren\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Wilt u een architectonisch statement ontwerpen dat stedenbouwkundige kenmerken vertaalt naar karaktervolle architectuur?\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-knikhuis-cronenburgh.ts\n");

