eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   torenwoningCronenburghLoenen: () => (/* binding */ torenwoningCronenburghLoenen)\n/* harmony export */ });\nconst torenwoningCronenburghLoenen = {\n    slug: \"architect-loenen-aan-de-vecht-torenwoning-cronenburgh\",\n    title: \"Torenwoning Cronenburgh\",\n    subtitle: \"Torenpitshuis als markant baken in Cronenburgh  onze eigen woning n architectenbureau in Loenen aan de Vecht\",\n    locationLabel: \"Locatie: Loenen aan de Vecht\",\n    tags: [\n        \"Architect Loenen aan de Vecht\",\n        \"Torenwoning\",\n        \"Torenpitshuis\",\n        \"Cronenburgh\",\n        \"West 8\",\n        \"Eigen woning\",\n        \"Architectenbureau\",\n        \"Nieuwbouw\",\n        \"Baksteen\",\n        \"Natuurlei\",\n        \"Vide\",\n        \"Dakterras\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        // Focus keyword: \"architect Loenen aan de Vecht\"\n        title: \"Architect Loenen aan de Vecht | Torenwoning Cronenburgh\",\n        description: \"Architect Loenen aan de Vecht: torenwoning (torenpitshuis) in Cronenburgh met 17,3 m hoogte, vide tot 4e verdieping en panoramisch dakterras. Eigen woning en kantoor.\",\n        keywords: [\n            \"architect Loenen aan de Vecht\",\n            \"torenwoning Cronenburgh\",\n            \"torenpitshuis Cronenburgh\",\n            \"nieuwbouw Loenen aan de Vecht\",\n            \"West 8 Cronenburgh specials\",\n            \"vide woning\",\n            \"dakterras toren\",\n            \"baksteen natuurlei gevel\",\n            \"architectenbureau Loenen aan de Vecht\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/cronenburgh-torenwoning-bijzondere-woning-loenen-architect.webp\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/cronenburgh-torenwoning-bijzondere-woning-loenen-architect.webp\",\n        alt: \"Architect Loenen aan de Vecht: torenwoning in Cronenburgh met baksteen en natuurlei als markant baken op de T-splitsing\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/cronenburgh-torenwoning-special-torenhuis-loenen-architect.webp\",\n            alt: \"Architect Loenen aan de Vecht: torenwoning als zichtpunt in Cronenburgh op de T-splitsing bij Keizer Ottolaan\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/61.jpg\",\n            alt: \"Architect Loenen aan de Vecht: torenwoning als zichtpunt in Cronenburgh op de T-splitsing bij Keizer Ottolaan\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/04/kavel-torenwoning-cronenburgh-3_resize2.jpg\",\n            alt: \"Architect Loenen aan de Vecht: silhouet van de torenwoning zichtbaar boven de daken van Cronenburgh\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Torenpitshuis als baken binnen Cronenburgh\",\n            content: \"Binnen het stedenbouwkundig plan Cronenburgh in Loenen aan de Vecht, ontworpen door West 8, zijn op zichtlocaties bijzondere kavels aangewezen voor specials: woningen met een markante vorm, ligging of eigenschap. Kavel 107 is daarin benoemd als het torenpitshuis.\\n\\nDe torenwoning vormt een herkenbaar punt op de T-splitsing van het verlengde van de Keizer Ottolaan en de nieuw aangelegde straten. Ook vanuit het zuiden is het dak van de torenwoning boven de andere huizen goed zichtbaar. Als architect in Loenen aan de Vecht hebben wij deze zichtlocatie vertaald naar een ontwerp dat niet schreeuwt, maar wel onmiskenbaar richting geeft aan de plek.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/71.jpg\",\n                alt: \"Architect Loenen aan de Vecht: torenwoning Cronenburgh op markante T-splitsing met zichtlijnen vanuit meerdere richtingen\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"Binnen het stedenbouwkundig plan Cronenburgh in Loenen aan de Vecht, ontworpen door West 8, zijn op zichtlocaties bijzondere kavels aangewezen voor specials: woningen met een markante vorm, ligging of eigenschap. Kavel 107 is benoemd als het torenpitshuis en vormt een herkenbaar punt op de T-splitsing van het verlengde van de Keizer Ottolaan. De opgave was om een woning te ontwerpen die functioneert als stedenbouwkundig baken n als eigen woning en kantoor van het architectenbureau  een gebouw dat richting geeft aan de plek zonder te domineren.\",\n            values: [\n                \"Torenpitshuis als stedenbouwkundig special\",\n                \"Markant baken op T-splitsing\",\n                \"Hoogte als interieurervaring (17,3 m)\",\n                \"Vide van begane grond tot 4e verdieping\",\n                \"Panoramisch uitzicht over Loenen aan de Vecht\",\n                \"Dakterras bovenop de toren\",\n                \"Baksteen en natuurlei met veranderend licht\",\n                \"Eigen woning n architectenbureau\"\n            ],\n            roleItems: [\n                \"Stedenbouwkundig: torenwoning als zichtpunt in Cronenburgh\",\n                \"Ruimtelijk concept: vide en trappenroute als verticale ruimte-ervaring\",\n                \"Programma: wonen en werken gecombineerd\",\n                \"Constructie: totale hoogte 17,3 meter met torenkamer\",\n                \"Materialisatie: ruwe baksteen en natuurlei op verschillend georinteerde vlakken\",\n                \"Buitenruimte: dakterras met panoramisch uitzicht\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Hoogte als interieurervaring: vide en trappenroute\",\n            content: \"Niet alleen aan de buitenzijde is de hoogte van de torenwoning te ervaren; ook in het interieur speelt de hoogte een hoofdrol. Met een totale hoogte van circa 17,3 meter ontstaat een ruimtelijke beleving die in een reguliere woning niet mogelijk is.\\n\\nEen vide vanaf de begane grond tot en met de vierde verdieping wordt begrensd en doorsneden door een route van trappen. Deze route leidt naar de torenkamer met panoramisch uitzicht over Loenen aan de Vecht en de omgeving. Voor wie zoekt naar een architect in Loenen aan de Vecht is dit project een voorbeeld van hoe een idee  hoogte en orintatie  niet alleen in de gevel, maar vooral in de dagelijkse beleving van de woning wordt verankerd.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/kavel-torenwoning-cronenburgh-2a_filtered.jpg\",\n                alt: \"Architect Loenen aan de Vecht: vide en trappenroute door de torenwoning met zicht op meerdere verdiepingen\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: true,\n            title: \"Panorama en dakterras bovenop de toren\",\n            content: \"De torenkamer vormt het eindpunt van de opgaande route en biedt een panoramisch uitzicht over Loenen aan de Vecht. Vanuit deze kamer is tevens een dakterras bereikbaar dat zich bovenop de toren bevindt. Het is een plek die het dorp en het landschap in n blik samenbrengt en de woning letterlijk verankert in zijn omgeving.\\n\\nStrategisch geplaatste gevelopeningen brengen daglicht diep de woning binnen en zorgen dat de toren niet alleen een icoon is van buitenaf, maar ook een lichte en comfortabele woonruimte blijft. Dit samenspel tussen uitzicht, licht en beschutting is kenmerkend voor onze aanpak als architect in Loenen aan de Vecht.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/DJI_0026_resize.jpg\",\n                alt: \"Architect Loenen aan de Vecht: dakterras bovenop de torenwoning met panoramisch uitzicht over Loenen en landschap\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/DSC4901_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: torenwoning Cronenburgh exterieur met baksteen en natuurlei\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/DSC4868_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: torenwoning als zichtpunt op T-splitsing\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/kavel-torenwoning-cronenburgh-3_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: silhouet torenwoning boven daken Cronenburgh\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/kavel-torenwoning-cronenburgh-4a_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: torenwoning op T-splitsing met zichtlijnen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/IMG_5407_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: vide en trappenroute door torenwoning\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/DJI_0024_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: dakterras met panoramisch uitzicht\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/kavel-torenwoning-cronenburgh-3_resize.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: detail baksteen en natuurlei gevel\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/dakterras-torenwoning.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: torenwoning als eigen woning en kantoor\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Materialisatie: baksteen en natuurlei met veranderend licht\",\n            content: \"Het volume van de toren vormt n geheel met dat van de woning in een zorgvuldig samenspel tussen een ruwe baksteengevel en een bekleding met natuurleien. De natuurlei ligt op verschillend georinteerde vlakken, waardoor elk vlak een andere tint krijgt afhankelijk van de tijd van de dag en de stand van de zon.\\n\\nDoor de amorfe vorm van de toren verandert het beeld vanuit elk perspectief: in vorm, in schaduwwerking en in kleurnuance. Voor Google-afbeeldingen en zoekers op 'architect Loenen aan de Vecht' is dit precies het soort project dat laat zien hoe materiaalkeuze en detaillering bijdragen aan een woning die dagelijks blijft verrassen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/kavel-torenwoning-cronenburgh-6a_resize.jpg\",\n                alt: \"Architect Loenen aan de Vecht: geveldetail van torenwoning met ruwe baksteen en natuurlei die van tint verandert\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Onze eigen woning en kantoor: het begin van het architectenbureau\",\n            content: \"De torenwoning speelt binnen onze projecten een bijzondere rol: niet alleen door de vorm, maar ook omdat dit onze eigen woning is  en tegelijk de plek waar het kantoor van het architectenbureau is gevestigd. Het zelf ontwerpen en bouwen van deze woning is de start geworden van het bureau en markeert onze specialisatie in de particuliere opdrachtgever.\\n\\nSamen met drie andere door ons ontworpen woningen is het project in 2007 opgeleverd. Niets is leerzamer dan zelf het volledige proces te doorlopen: van ontwerp en afstemming tot uitvoering en bewoning. Die ervaring nemen we sindsdien mee in elk project als architect in Loenen aan de Vecht: met aandacht voor keuzes die op papier kloppen n in het dagelijks leven werken.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/41.jpg\",\n                alt: \"Architect Loenen aan de Vecht: torenwoning Cronenburgh als eigen woning en kantoor van het architectenbureau\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Architect in Loenen aan de Vecht\",\n        headline: \"Een woning ontwerpen die klopt als baken in de omgeving n als thuis\",\n        buttonLabel: \"Neem contact op\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-torenwoning-cronenburgh.ts\n");

