eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   villaKasteelparkDeCloese: () => (/* binding */ villaKasteelparkDeCloese)\n/* harmony export */ });\nconst villaKasteelparkDeCloese = {\n    slug: \"architect-loenen-aan-de-vecht-villa-kasteelpark-de-cloese\",\n    title: \"Villa Kasteelpark De Cloese Lochem\",\n    subtitle: \"Moderne villa aan een historische buitenplaats, waar landschap, uitzicht en architectuur samensmelten\",\n    locationLabel: \"Locatie: Kasteelpark De Cloese Lochem\",\n    tags: [\n        \"Architect Loenen aan de Vecht\",\n        \"Villa Kasteelpark De Cloese\",\n        \"Moderne villa\",\n        \"Woning aan landschapspark\",\n        \"Historische buitenplaats\",\n        \"Villa met grote kap\",\n        \"Paviljoenwoning\",\n        \"Uitzicht op landschap\",\n        \"Vergunningsvrije overkapping\",\n        \"Roomdivider interieur\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        // Focus keyword: \"architect Lochem villa\"\n        title: \"Architect Lochem villa Kasteelpark De Cloese\",\n        description: \"Architect Loenen aan de Vecht: moderne villa aan historische buitenplaats De Cloese met verhoogde woonruimtes, paviljoenachtige vorm en maximale relatie met landschap.\",\n        keywords: [\n            \"architect Loenen aan de Vecht\",\n            \"villa Kasteelpark De Cloese\",\n            \"moderne villa in landschapspark\",\n            \"woning aan historische buitenplaats\",\n            \"villa met grote kap\",\n            \"paviljoen woning\",\n            \"villa met uitzicht op landschap\",\n            \"vergunningsvrije overkapping villa\",\n            \"moderne villa met kap\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-kavel-architect-lochem.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-kavel-architect-lochem.jpg\",\n        alt: \"Architect Achterhoek villa aan Kasteelpark De Cloese met grote kap en open zicht op het landschapspark\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-architect-lochem-kavel.jpg\",\n            alt: \"Architect Lochem: uitzicht vanuit de villa over het historische landschapspark De Cloese\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/Villa-lochem-architect.jpg\",\n            alt: \"Architect Lochem paviljoenachtige villa met grote kap als deken over het hoofdvolume\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Wonen aan een historische buitenplaats\",\n            content: \"Het mooiste plekje van Nederland, volgens de verkopend makelaar  en dat gevoel wordt direct bevestigd door de locatie zelf. De woning grenst aan een historische buitenplaats met een prachtig aangelegd landschapspark en monumentale bomen die letterlijk de achtertuin vormen.\\n\\nDoor de woonkamer, keuken en buitenruimte verhoogd aan te leggen wordt het zicht op dit landschap diep de woning in getrokken. Het groen, het licht en de seizoenen maken zo onlosmakelijk deel uit van het dagelijks wonen. Voor ons als architect in Loenen aan de Vecht vormt dit type locatie het ideale vertrekpunt voor een ontwerp waarin architectuur en landschap elkaar versterken.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-architect-lochem.jpg\",\n                alt: \"Architect Loenen aan de Vecht: verhoogde woonruimtes met uitzicht op landschapspark en monumentale bomen\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"De opdrachtgever wilde een eigentijdse woning bouwen op een unieke locatie: een kavel grenzend aan het historische landschapspark van Kasteelpark De Cloese, met uitzicht op monumentale bomen en het oude kasteel. Het beeldkwaliteitsplan stond geen plat dak toe, terwijl de opdrachtgever juist een moderne kubuswoning voor ogen had. De opgave was om binnen deze randvoorwaarden een woning te ontwerpen die maximaal profiteert van het uitzicht, de rust en de historische context  een ontwerp waarin architectuur en landschap onlosmakelijk met elkaar verbonden zijn.\",\n            values: [\n                \"Wonen aan historische buitenplaats De Cloese\",\n                \"Verhoogde woonruimtes voor maximaal uitzicht\",\n                \"Grote kap over kubusvolume (plat dak + schuine kap)\",\n                \"Paviljoenachtig karakter met open gevelopeningen\",\n                \"Vergunningsvrije overkapping als verlengd buitenleven\",\n                \"Roomdivider met open haard als ruimteverdeler\",\n                \"Regionale verwijzing naar grote kappen en schuren\",\n                \"Maximale relatie tussen interieur en landschap\"\n            ],\n            roleItems: [\n                \"Stedenbouwkundig: kavel aan rand van historisch landschapspark\",\n                \"Ruimtelijk concept: kubusvolume met grote kap als deken\",\n                \"Programma: verhoogde woonruimtes, open plattegrond met zicht op kasteel\",\n                \"Constructie: kap over plat dak creert overgangszones\",\n                \"Gevel: grote openingen gericht op landschap en monumentale bomen\",\n                \"Buitenruimte: vergunningsvrije overkapping als verlengd wonen\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Regionale referenties: grote kappen en schuren\",\n            content: \"De vormgeving van de woning refereert aan de in de regio kenmerkende woningen en schuren met grote kappen. In dit ontwerp zijn deze elementen echter niet letterlijk gekopieerd, maar vertaald naar een eigentijdse, paviljoenachtige woning.\\n\\nDe grote kap fungeert als overkoepelend element waaronder een open, lichte woning schuilgaat. Grote gevelopeningen richten zich nadrukkelijk op het uitzicht en maken het landschap tot een verlengstuk van het interieur. Zo ontstaat een moderne villa die herkenbaar is in haar context, maar tegelijkertijd een eigen identiteit heeft.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/villa-lochem-architekt.jpg\",\n                alt: \"Architect Loenen aan de Vecht: moderne villa met grote kap als verwijzing naar regionale schuurarchitectuur\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Het spanningsveld tussen plat dak en schuine kap\",\n            content: \"De opdrachtgever wenste een eigentijdse woning met een plat dak. Het beeldkwaliteitsplan liet dit echter niet toe. In plaats van deze beperking als belemmering te zien, is juist dit spanningsveld het centrale thema van het ontwerp geworden.\\n\\nDe woning is in essentie een kubuswoning met een plat dak, waarover een schuine kap als een soort deken is gelegd. Hierdoor ontstaan bijzondere overgangen tussen binnen en buiten, tussen hoog en laag, open en gesloten. Deze overgangszones geven de woning een extra laag ruimtelijke kwaliteit en maken het ontwerp rijker dan een eenduidige vorm ooit zou kunnen zijn.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/moderne-villa-achterhoek-architekt.jpg\",\n                alt: \"Architect Loenen aan de Vecht: overgangen tussen plat dak en schuine kap bij villa De Cloese\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/stalen-dak-houten-gevel.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: villa aan Kasteelpark De Cloese met grote kap\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-hout.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: uitzicht vanuit villa over historisch landschapspark\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-lochem-twente-achterhoek-architect.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: paviljoenachtige villa met grote kap\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/villa-lochem.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: verhoogde woonruimtes met uitzicht op park\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-kavel-architect-lochem.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: grote kap als regionale verwijzing\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2015/06/vrijstaande-villa-architect-lochem-kavel.jpg\",\n                    alt: \"Architect Loenen aan de Vecht: overgangen tussen plat dak en schuine kap\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Binnen en buiten naadloos verbonden\",\n            content: \"Aan de achterzijde is een vergunningsvrije overkapping gerealiseerd die het wonen verder naar buiten verlengt. Samen met de verhoogde ligging van de woonruimtes ontstaat een sterke relatie tussen interieur, terras en landschap.\\n\\nDe woning maakt zo maximaal gebruik van de randvoorwaarden en van de uitzonderlijke locatie. Het paviljoenachtige karakter zorgt ervoor dat de woning zich opent naar het groen, terwijl de kap beschutting en geborgenheid biedt.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-lochem-villa-kasteelpark-de-cloese-overkapping.jpg\",\n                alt: \"Architect Loenen aan de Vecht: vergunningsvrije overkapping als verlengstuk van wonen en landschap\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Een open plattegrond met zicht op het oude kasteel\",\n            content: \"De lichte eetkeuken en woonkamer worden van elkaar gescheiden door een roomdivider waarin kasten, een open haard en techniek zijn gentegreerd. Deze ingreep verdeelt de ruimte zonder het open karakter te verliezen.\\n\\nDe plattegrond is zo opgezet dat vanuit vrijwel elke positie zicht bestaat op het omliggende groen en het oude kasteel in het park. Het resultaat is een ruimtelijke, ontspannen woning die dagelijks herinnert aan de bijzondere plek waarop zij staat  een villa die niet alleen ontworpen is om in te wonen, maar om de omgeving intens te beleven.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2018/05/kavel-lochem-villa-architect-bouwgrond_resize.jpg\",\n                alt: \"Architect Loenen aan de Vecht: open plattegrond met roomdivider en zichtlijnen naar park en kasteel\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Architect in Loenen aan de Vecht\",\n        headline: \"Architectuur die beperkingen omzet in ruimtelijke kwaliteit\",\n        buttonLabel: \"Neem contact op\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-villa-kasteelpark-de-cloese.ts\n");

