eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   villaOvergooiAlmere: () => (/* binding */ villaOvergooiAlmere)\n/* harmony export */ });\nconst villaOvergooiAlmere = {\n    slug: \"architect-loenen-aan-de-vecht-vrijstaande-villa-almere-overgooi\",\n    title: \"Vrijstaande Villa Almere Overgooi\",\n    subtitle: \"Energie-neutrale villa als landschappelijk ensemble in Overgooi, met woonhuis op heuvel en slaaphuis verzonken in het bos\",\n    locationLabel: \"Locatie: Almere Overgooi\",\n    tags: [\n        \"Nieuwbouw\",\n        \"Energie-neutraal\",\n        \"Bosvilla\",\n        \"Nul-op-de-meter\",\n        \"Green Award\",\n        \"Almere Overgooi\",\n        \"Woonhuis op heuvel\",\n        \"Verzonken slaaphuis\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"verduurzaming\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Villa Almere Overgooi | Architect Jules Zwijsen\",\n        description: \"Energie-neutrale villa in Almere Overgooi met woonhuis op heuvel, verzonken slaaphuis, groendak en gentegreerde PV-panelen. Green Award bekroond.\",\n        keywords: [\n            \"architect Loenen aan de Vecht\",\n            \"villa Almere Overgooi\",\n            \"bosvilla Almere\",\n            \"energie neutrale villa\",\n            \"nul op de meter woning\",\n            \"woonhuis op heuvel\",\n            \"slaaphuis verzonken\",\n            \"groendak terras\",\n            \"pv panelen in dak\",\n            \"zinken dak villa\",\n            \"regenwateropvang tank\",\n            \"Green Award woning\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/xx/architect-loenen-aan-de-vecht-villa-almere-overgooi-og.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2018/04/Almere-overgooi-luxe-villa-architect-kavel-modern-2-1.jpg\",\n        alt: \"Villa Almere Overgooi  landschappelijk ensemble met woon- en slaaphuis\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2018/04/Almere-overgooi-luxe-villa-architect-kavel-modern-2-1.jpg\",\n            alt: \"Woonhuis op heuvel met uitzicht over kavel en bos in Overgooi\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-7.jpg\",\n            alt: \"Entree bereikbaar via grote treden als landschappelijke oprijlaan\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6513a_resize.jpg\",\n            alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Architectuur in een Boslandschap\",\n            content: \"Almere Overgooi is opgezet als een paradepaardje voor Almere: een woongebied waarin hoogwaardige architectuur en bosstroken samen een bijzonder landschap vormen.\\n\\nMet het ontwerp van de woning n de tuin is getracht deze kenmerken te versterken. De villa staat niet als los object op de kavel, maar is hiermee volledig versmolten. Door de bestaande, door de gemeente aangeplante bosrand te vergroten, ontstaan plekken in de tuin met meer of minder privacy.\\n\\nZo wordt de buitenruimte niet alleen een decor, maar een integraal onderdeel van het woonconcept. Dit is een benadering die past bij onze werkwijze als architect in Loenen aan de Vecht: woning en landschap als n ontwerp behandelen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/666_2160.jpg\",\n                alt: \"Tuinontwerp vergroot bosrand en creert privacyzones rondom villa\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"De opdrachtgever zocht een energie-neutrale villa in Almere Overgooi die volledig integreert met het boslandschap. De ambitie was om wonen en natuur te laten versmelten, met privacy, rust en duurzaamheid als uitgangspunt. De kavel vroeg om een zorgvuldige strategie rondom privacy, zichtlijnen en de verhouding tussen woon- en slaapfuncties.\",\n            values: [\n                \"Landschapsarchitectuur als geheel\",\n                \"Woning en tuin versmolten\",\n                \"Privacy door bosstroken\",\n                \"Energie-neutraal (nul-op-de-meter)\",\n                \"Gescheiden woon- en slaapfuncties\",\n                \"Duurzaam en circulair\",\n                \"Green Award bekroond (3e prijs)\",\n                \"Installaties gentegreerd in architectuur\"\n            ],\n            roleItems: [\n                \"Ruimtelijk concept: woonhuis op heuvel, slaaphuis verzonken\",\n                \"Tuin- en landschapsontwerp met privacy-zones\",\n                \"Energie-neutrale installatiestrategie (PV, zonneboiler, pelletkachel)\",\n                \"Materialisatie: zinken dak, gentegreerde heatpipes\",\n                \"Regenwateropvang en circulaire waterbenutting\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Woonhuis op een Heuvel: Uitzicht als Dagelijkse Kwaliteit\",\n            content: \"Het woonhuis met woonkamer en keuken ligt op een heuvel en profiteert daardoor van een prachtig uitzicht over de kavel en het achtergelegen bos.\\n\\nDe entree ligt in het hart van de woning en wordt te voet bereikt via een 'oprijlaan' van grote treden. De auto is uit het zicht geplaatst onder het woonhuis. Deze opzet maakt de aankomst sereen en landschappelijk, en zorgt dat de woning zich openstelt naar groen en licht in plaats van naar het parkeren.\\n\\nHet resultaat is een villa die niet alleen in Overgooi past, maar de kwaliteiten van het boslandschap actief versterkt.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_7786_resize.jpg\",\n                alt: \"Woonkamer en keuken op verhoogde heuvel met uitzicht over bos\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Slaaphuis Verzonken in de Tuin: Privacy en Stilte\",\n            content: \"Onder het opgetilde woonhuis ontstaat ruimte voor een 'slaaphuis' dat verzonken in de tuin ligt. Aan de slaapkamers liggen verdiepte open plekken in het bos, waardoor privacy en rust vanzelfsprekend zijn.\\n\\nDeze plekken voelen als kamers in het landschap: beschut, groen en intiem. Het ontwerp maakt daarmee een duidelijke scheiding tussen de representatieve woonlaag en de stille slaaplaag, zonder dat het n geheel uit het oog verliest.\\n\\nDoor de woning te stapelen in het landschap ontstaat een rijke woonbeleving die past bij de ambities van Overgooi.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-5.jpg\",\n                alt: \"Verzonken slaaphuis met beschutte boskamers voor privacy\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2018/04/Almere-overgooi-luxe-villa-architect-kavel-modern-2-1.jpg\",\n                    alt: \"Exterieur villa als landschappelijk ensemble tussen bosstroken\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2018/04/Almere-overgooi-luxe-villa-architect-kavel-modern-1-1.jpg\",\n                    alt: \"Dak van slaaphuis als terras en ordenend tuinelement\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2018/04/Almere-overgooi-luxe-villa-architect-kavel-modern-3-1.jpg\",\n                    alt: \"Vergroot bosrand creert privacyzones rondom villa\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6489a_resize.jpg\",\n                    alt: \"Woonhuis op heuvel met uitzicht over kavel en bos\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6485a_resize.jpg\",\n                    alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6335_resize.jpg\",\n                    alt: \"Exterieur villa als landschappelijk ensemble tussen bosstroken\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6095_resize.jpg\",\n                    alt: \"Dak van slaaphuis als terras en ordenend tuinelement\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_7798_resize_resize.jpg\",\n                    alt: \"Vergroot bosrand creert privacyzones rondom villa\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6101_resize.jpg\",\n                    alt: \"Woonhuis op heuvel met uitzicht over kavel en bos\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6188_resize.jpg\",\n                    alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-1.jpg\",\n                    alt: \"Woonhuis op heuvel met uitzicht over kavel en bos\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-2.jpg\",\n                    alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-3.jpg\",\n                    alt: \"Exterieur villa als landschappelijk ensemble tussen bosstroken\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-4.jpg\",\n                    alt: \"Dak van slaaphuis als terras en ordenend tuinelement\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-5.jpg\",\n                    alt: \"Vergroot bosrand creert privacyzones rondom villa\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-6.jpg\",\n                    alt: \"Woonhuis op heuvel met uitzicht over kavel en bos\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/luxe-villa-architect-overgooi-kavel-8.jpg\",\n                    alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/10/666_2160.jpg\",\n                    alt: \"Entree via grote treden als landschappelijke oprijlaan\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Dak van het Slaaphuis als Ordenend Tuin-element\",\n            content: \"Het dak van het slaaphuis is opgevat als een veelzijdig en ordenend element in de tuin. Het kan dienen als terras, groendak, zwembad of als robuuste buitenvloer die de verschillende tuinruimtes verbindt.\\n\\nIn het verlaagde deel van de woning zijn bovendien opslag, techniek en een ruime berging opgenomen. Daarmee blijven deze functies uit het zicht en bepalen ze niet het beeld van de villa, terwijl ze logisch aansluiten op de parkeerplek van de auto.\\n\\nHet is een praktische, maar ook esthetische keuze: de woning blijft helder en rustig in haar hoofdvorm.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_6188_resize.jpg\",\n                alt: \"Dak van slaaphuis als veelzijdig terras en tuinelement\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: true,\n            title: \"Energie-neutraal: Installaties Gentegreerd in Architectuur\",\n            content: \"Door een uitgekiende installatie is de woning energie-neutraal: het huis heeft geen externe energie nodig. De installaties zijn daarbij onderdeel van de architectuur.\\n\\nIn het zinken dak zijn PV-panelen gentegreerd voor elektriciteit, terwijl heatpipes van de zonneboiler zijn opgenomen als afdak boven en naast de entree. Een pelletkachel werkt in combinatie met de zonneboiler, zodat er geen aanvullende energiebron nodig is.\\n\\nRegenwater wordt opgevangen in een grote ondergrondse tank en hergebruikt voor diverse toepassingen. Het project werd bekroond met de derde prijs van de Green Award  een bevestiging dat duurzaamheid hier niet een toevoeging is, maar een integraal ontwerpprincipe.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2014/11/IMG_4991_resize.jpg\",\n                alt: \"Zinken dak met gentegreerde PV-panelen en heatpipes\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Wilt u een villa ontwerpen die landschap, privacy en duurzaamheid samenbrengt?\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-vrijstaande-villa-almere-overgooi.ts\n");

