eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   woningWerkplaatsSeggelenAlmere: () => (/* binding */ woningWerkplaatsSeggelenAlmere)\n/* harmony export */ });\nconst woningWerkplaatsSeggelenAlmere = {\n    slug: \"architect-loenen-aan-de-vecht-woning-werkplaats-almere-poort\",\n    title: \"Woning met Werkplaats  Familie van Seggelen\",\n    subtitle: \"Woning met atelier aan het water in Almere Poort, waar landschap, ambacht en architectuur samenkomen\",\n    locationLabel: \"Locatie: Almere Poort\",\n    tags: [\n        \"Nieuwbouw\",\n        \"Zelfbouw\",\n        \"Woning met werkplaats\",\n        \"Atelier aan huis\",\n        \"Almere Poort\",\n        \"Woning aan het water\",\n        \"Natuurleien\",\n        \"Zinken dakkapellen\",\n        \"Houten spanten\",\n        \"Prijswinnend\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Woning met Werkplaats Almere Poort | Architect Jules Zwijsen\",\n        description: \"Zelfbouw woning met atelier in Almere Poort aan water en plein, met terraskamer, uitzichtkamer, natuurleien gevel en houten spanten. Bekroond met Zelfbouwprijs.\",\n        keywords: [\n            \"architect woning werkplaats\",\n            \"zelfbouw Almere Poort\",\n            \"atelier aan huis\",\n            \"woning aan het water\",\n            \"natuurleien gevel\",\n            \"zinken dakkapellen\",\n            \"houten spanten woning\",\n            \"werkruimte aan huis\",\n            \"zelfbouwprijs Almere\",\n            \"terraskamer uitzichtkamer\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/xx/architect-loenen-aan-de-vecht-woning-werkplaats-almere-poort-og.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2016/10/160712_Damoclesstraat_foto_martin_Kuijper.jpg\",\n        alt: \"Woning met werkplaats Almere Poort  zelfbouw aan het water met natuurleien\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-15.jpg\",\n            alt: \"Exterieur woning met werkplaats aan het water in Almere Poort\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-20.jpg\",\n            alt: \"Woning aan plein met atelier en beschutte tuin\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-.jpg\",\n            alt: \"Waterzijde met vlonder en uitzicht op groen landschap\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Ontwerp Gestuurd door Plein en Water\",\n            content: \"De kavel grenst aan de westzijde aan een groot plein met een hoog appartementengebouw en aan de noordzijde aan het water, met daarachter een vrij en groen gebied waarin zich een historische scheepswrakvindplaats bevindt.\\n\\nDeze twee sterk contrasterende omstandigheden  stedelijke schaal aan de ene zijde en open landschap aan de andere  hebben het ontwerp en de positionering van de woning op de kavel bepaald.\\n\\nHet lezen van zulke contextuele spanningen is vaak het beginpunt voor een ontwerp dat vanzelfsprekend aanvoelt op zijn plek.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2016/10/160712_Damoclesstraat_foto_martin_Kuijper.jpg\",\n                alt: \"Ligging woning tussen plein en water in Almere Poort\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"De opdrachtgever, eigenaar van Segment Timmerwerk, zocht een woning met werkplaats/atelier op een kavel tussen een groot stedelijk plein en het water in Almere Poort. De opgave was om de woning zo te positioneren dat deze profiteert van het uitzicht op het water en het groene landschap, terwijl de relatie met het drukke plein beheersbaar blijft. Daarnaast moest de woning geschikt zijn voor zelfbouw en fungeren als visitekaartje van vakmanschap.\",\n            values: [\n                \"Contextuele spanning tussen plein en water\",\n                \"Privacy en uitzicht combineren\",\n                \"Woning met atelier/werkruimte\",\n                \"Zelfbouw als visitekaartje vakmanschap\",\n                \"Flexibel voor toekomstig gebruik\",\n                \"Verticale gelaagdheid (terraskamer + uitzichtkamer)\",\n                \"Natuurlijke materialisatie\",\n                \"Prijswinnend ontwerp\"\n            ],\n            roleItems: [\n                \"Kavelanalyse: plein, water en landschap als context\",\n                \"Positionering: verhoogde nokhoogte als afscherming en luwte\",\n                \"Ruimtelijk concept: twee woonkamers op verschillende niveaus\",\n                \"Atelier en woning als samenhangend ensemble\",\n                \"Materialisatie: natuurleien, zink en houten spanten\",\n                \"Begeleiding zelfbouw door Segment Timmerwerk\"\n            ],\n            partners: [\n                {\n                    label: \"Zelfbouw\",\n                    value: \"Segment Timmerwerk (Kees van Seggelen)\"\n                },\n                {\n                    label: \"Prijzen\",\n                    value: \"Mooiste huis Almere Poort, Architectuurbijdrage Almere, Zelfbouwprijs Almere\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Hoogte als Bescherming en Ruimtelijke Kwaliteit\",\n            content: \"Om het hoge appartementengebouw aan het plein zoveel mogelijk uit het zicht te houden, is aan deze zijde gekozen voor een hogere nokhoogte. Deze ingreep heeft meerdere effecten: niet alleen wordt het zicht vanuit de tuin gefilterd, ook ontstaat er een aangename luwte tegen de vaak aanwezige westenwind die vrij spel heeft over het plein.\\n\\nDe woning vormt zo een beschut microklimaat in de tuin, terwijl de hoogte tegelijk bijdraagt aan de ruimtelijke gelaagdheid van het ontwerp. Het is een voorbeeld van hoe architectuur comfort, landschap en stedelijke context kan verbinden.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-.jpg\",\n                alt: \"Verhoogde nokhoogte schermt plein af en creert luwte in tuin\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Twee Woonkamers op Verschillende Niveaus\",\n            content: \"Het hoogteverschil tussen de kavel en het water is benut door het realiseren van twee boven elkaar gelegen woonkamers. De lager gelegen terraskamer grenst direct aan het buitenterras en de vlonder aan het water en vormt een intieme plek dicht bij het landschap.\\n\\nDaarboven ligt een hoger gelegen uitzichtkamer die een weids en vrij zicht biedt richting het verderop gelegen Pampusbos. Deze verticale gelaagdheid maakt het mogelijk om op verschillende momenten van de dag en in verschillende seizoenen andere kwaliteiten van de plek te ervaren.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-09.jpg\",\n                alt: \"Uitzichtkamer en terraskamer met zicht op water en landschap\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Woning en Atelier als Samenhangend Ensemble\",\n            content: \"Naast de woning is een atelier met berging geplaatst dat de tuin afschermt van de straat. De woning en het bijgebouw zijn verbonden door de hoofdentree en functioneren samen als n ensemble.\\n\\nDeze opzet maakt het mogelijk om het atelier in de toekomst zelfstandig te gebruiken ten behoeve van een beroep aan huis. Daarmee is de woning niet alleen afgestemd op het huidige gebruik, maar ook flexibel richting de toekomst.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-08.jpg\",\n                alt: \"Atelier en berging vormen samen met woning een beschut ensemble\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-18.jpg\",\n                    alt: \"Exterieur woning met werkplaats aan het water\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-16.jpg\",\n                    alt: \"Waterzijde met vlonder en uitzicht op groen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-14.jpg\",\n                    alt: \"Woning aan plein met atelier en beschutte tuin\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-07.jpg\",\n                    alt: \"Detail natuurleien gevel en zinken dakkapellen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-interieur.jpg\",\n                    alt: \"Interieur met houten gelamineerde spanten\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-03.jpg\",\n                    alt: \"Waterzijde met vlonder en uitzicht op groen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-02.jpg\",\n                    alt: \"Woning aan plein met atelier en beschutte tuin\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2013/11/woon-werk-villa-aan-het-water-almere-01.jpg\",\n                    alt: \"Detail natuurleien gevel en zinken dakkapellen\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-Gooi.jpg\",\n                    alt: \"Interieur met houten gelamineerde spanten\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-leisteen.jpg\",\n                    alt: \"Terraskamer met directe aansluiting op vlonder\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Materialisatie, Ambacht en Zelfbouw\",\n            content: \"De materialisatie bestaat uit een gemetselde gevel aan de straatzijde en een gevel- en dakbekleding van natuurleien, gecombineerd met zinken dakkapellen. Beeldbepalend zijn de houten gelamineerde spanten die het constructieve frame van de woning vormen en ook in het interieur zichtbaar blijven.\\n\\nHet bijzondere aan deze woning is dat zij grotendeels door de opdrachtgever zelf is gebouwd. Kees van Seggelen, eigenaar van Segment Timmerwerk, heeft de woning in circa drie jaar gerealiseerd naast zijn reguliere werkzaamheden.\\n\\nDe woning fungeert daarmee als visitekaartje: maatwerk meubels, kasten, boekenkasten en keukenelementen maken het interieur tot een showroom van vakmanschap. Het project werd bekroond met meerdere prijzen, waaronder 'Het mooiste huis van Almere Poort', de 'Architectuurbijdrage Almere' en de 'Zelfbouwprijs Almere'.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2019/03/kavel-architect-moderne-woning-villa-interieur.jpg\",\n                alt: \"Interieur met houten gelamineerde spanten en maatwerk meubels\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"lg\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Wilt u een woning met werkruimte ontwerpen die plek, ambacht en gebruik laat samenkomen?\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/architect-loenen-aan-de-vecht-woning-werkplaats-almere-poort.ts\n");

