eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   moderneVillaGebogenGevelGooiEnVechtstreek: () => (/* binding */ moderneVillaGebogenGevelGooiEnVechtstreek)\n/* harmony export */ });\nconst moderneVillaGebogenGevelGooiEnVechtstreek = {\n    slug: \"moderne-villa-gebogen-gevel-gooi-en-vechtstreek\",\n    title: \"Moderne villa met gebogen gevel\",\n    subtitle: \"Architectuur met tijdloze klasse: een moderne villa waarin een gebogen glasgevel twee zwevende betonnen volumes verbindt voor panoramisch wonen, privacy en een sterke binnen-buiten beleving.\",\n    locationLabel: \"Locatie: Gooi en Vechtstreek\",\n    tags: [\n        \"Moderne villa\",\n        \"Gebogen glasgevel\",\n        \"Het Gooi\",\n        \"Gooi en Vechtstreek\",\n        \"Beton\",\n        \"Zwevende volumes\",\n        \"Panoramisch uitzicht\",\n        \"Souterrain\",\n        \"Kelderoplossingen\",\n        \"Levensloopbestendig\",\n        \"Domotica\",\n        \"Zwembad\",\n        \"Luxe architectuur\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Moderne villa met gebogen glasgevel in Het Gooi | Architect Jules Zwijsen\",\n        description: \"Moderne villa met gebogen glasgevel in de Gooi en Vechtstreek. Twee zwevende betonnen volumes, souterrain design en een naadloze binnen-buiten beleving met panoramisch uitzicht op groen en zwembad.\",\n        keywords: [\n            \"moderne villa Het Gooi\",\n            \"architect Het Gooi\",\n            \"villa met gebogen glasgevel\",\n            \"gebogen gevel villa\",\n            \"betonnen villa ontwerp\",\n            \"souterrain design\",\n            \"kelderoplossingen villa\",\n            \"luxe villa Gooi en Vechtstreek\",\n            \"panoramisch wonen\",\n            \"waardevaste woning\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-verlichting-beton-zwembad.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-verlichting-beton-zwembad.jpg\",\n        alt: \"Moderne villa met gebogen glasgevel, betonnen volumes en zwembadverlichting in een groene omgeving.\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-verlichting-beton-zwembad.jpg\",\n            alt: \"Avondbeeld moderne villa met gebogen glasgevel, betonnen volumes en zwembad; architectuur met tijdloze klasse.\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-het-gooi.jpg\",\n            alt: \"Gebogen glazen gevel die groen en zwembad omarmt; panoramisch uitzicht vanuit elke hoek.\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-vechtstreek.jpg\",\n            alt: \"Zicht op de gebogen gevel en de balans tussen transparantie en gesloten volumes.\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Architectuur met tijdloze klasse\",\n            content: \"Dit ontwerp voor een exclusieve residentie in de Gooi en Vechtstreek is een zero-compromise visie op wonen in de natuur. De woning vormt een precieze overgang tussen het beschutte bosperceel en strakke, moderne leefruimtes.\\n\\nDe centrale, gebogen glazen gevel omarmt het groen en het zwembad en creert een ongevenaard panoramisch uitzicht vanuit vrijwel elke positie in de leefruimtes.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-vechtstreek.jpg\",\n                alt: \"Moderne villa met gebogen glasgevel in de Gooi en Vechtstreek; de gevel vormt de overgang tussen landschap en interieur.\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"Architectuur met Tijdloze Klasse\",\n            values: [\n                \"Zero-compromise ontwerpvisie\",\n                \"Panoramisch wonen met gebogen glasgevel\",\n                \"Balans tussen transparantie en privacy\",\n                \"Discreet luxe constructie en detaillering\",\n                \"Waardevast en toekomstgericht\"\n            ],\n            roleItems: [\n                \"Concept: gebogen centrale as als ruimtelijke ruggengraat\",\n                \"Massing: twee zwevende, gesloten betonnen volumes\",\n                \"Privacystrategie: slaap- en werkkamers in gesloten delen\",\n                \"Lichtstrategie: maximale lichtinval via gebogen glaswand\",\n                \"Binnen-buiten: directe relatie met zwembad en tuinen\",\n                \"Techniek: souterrain/kelderoplossingen gentegreerd in het ontwerp\",\n                \"Toekomst: levensloopbestendig gedacht met domotica en duurzame materialisering\"\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"De gebogen glasgevel als strategisch antwoord op panoramisch wonen\",\n            content: \"De kracht van deze moderne villa ligt in de strategische plaatsing van contrasterende maar harmonieuze vormen. De gebogen, centrale as verbindt twee gesloten betonnen volumes en verdeelt functies op een vanzelfsprekende manier.\\n\\nMeerwaarde van deze ontwerpstrategie:\\n- Maximale lichtinval door een enorme glazen faade\\n- Volledige privacy in de betonnen delen (slaap- en werkkamers)\\n- Naadloze binnen-buiten beleving rondom zwembad en tuinen\\n\\nIn combinatie met een zorgvuldig ontworpen souterrain wordt de woning gepositioneerd als een waardevaste, tijdloze villa in Het Gooi.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-het-gooi.jpg\",\n                alt: \"Gebogen glasgevel als centrale as: panoramisch wonen met maximale lichtinval en zicht op zwembad en groen.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"horizontal\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/moderne-villa-verlichting-beton-zwembad.jpg\",\n                    alt: \"Avondbeeld van de moderne villa met zwembad en gebogen glasgevel.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-het-gooi.jpg\",\n                    alt: \"Gebogen glasgevel die de tuin en het zwembad omarmt; panoramisch wonen.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-moderne-villa-gebogen-gevel-vechtstreek.jpg\",\n                    alt: \"Zicht op de gebogen gevel en de balans tussen transparantie en gesloten volumes.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/zwembad-villa-kinderen-luxe-tuin.jpg\",\n                    alt: \"Zwembadzone als verlengstuk van de woonruimte; naadloze binnen-buiten beleving.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-gebogen-glas-panoramisch-uitzicht.jpg\",\n                    alt: \"Interieur met gebogen glaswand en maximaal daglicht; zichtlijnen rondom het groen.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/modern-interieur-gebogen-villa-luxe-architect.jpg\",\n                    alt: \"Modern maatwerk interieur met beton en hout; warme luxe in strakke architectuur.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/villa-entree-brede-houten-deur-sportwagen.jpg\",\n                    alt: \"Monumentale entree met brede houten deur en strakke betonnen trap; discrete luxe.\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: true,\n            title: \"Zwevende volumes: discrete luxe en waardevastheid\",\n            content: \"De technische realisatie is gericht op discrete luxe. De twee zwevende betonnen volumes worden gedragen door een constructieve opzet die het geheel licht en moeiteloos laat ogen.\\n\\nDit vraagt om kelderoplossingen van de hoogste kwaliteit, waarin functionele en technische ruimtes naadloos worden gentegreerd. De strakke betonnen trappartij aan de voorzijde onderstreept de monumentale entree en maakt het contrast tussen gesloten massa en transparante leefzone voelbaar.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/villa-entree-brede-houten-deur-sportwagen.jpg\",\n                alt: \"Monumentale entree met strakke betonnen trap en brede houten deur; versterkt de luxe en het contrast in de compositie.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Een maatwerk oase van licht en openheid\",\n            content: \"Het interieur is een directe reflectie van de strakke architectuur. De open plattegrond wordt versterkt door de enorme lichtinval via de gebogen glaswand, waardoor elke ruimte een levend contact houdt met bos en water.\\n\\nOveral is sprake van maatwerk: materialen zoals de gepolijste betonvloer en warme houten accenten zijn gekozen om de moderne esthetiek te complimenteren en tegelijk een rustige, warme sfeer te creren. De leefruimtes functioneren als heldere rustpunten met een constant panoramisch uitzicht.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/interieur-gebogen-glas-panoramisch-uitzicht.jpg\",\n                alt: \"Interieur met gebogen glaswand: panoramisch uitzicht, veel daglicht en een open plattegrond met maatwerk afwerking.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Uw partner voor exclusieve architectuur\",\n        headline: \"Maak kennis met onze aanpak en ontdek wat we voor uw woonplannen kunnen betekenen. U zit nergens aan vast.\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/moderne-villa-gebogen-gevel-gooi-en-vechtstreek.ts\n");

