eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   prefabHoutenVillaMetPatiosBilthoven: () => (/* binding */ prefabHoutenVillaMetPatiosBilthoven)\n/* harmony export */ });\nconst prefabHoutenVillaMetPatiosBilthoven = {\n    slug: \"prefab-houten-villa-met-patios-bilthoven\",\n    title: \"Prefab houten villa met patios\",\n    subtitle: \"Architectuur met perfectie: zero-compromise kwaliteit, prefab precisie en patios als discreet luxe overgang van binnen naar buiten.\",\n    locationLabel: \"Locatie: Bilthoven\",\n    tags: [\n        \"Prefab\",\n        \"Houten villa\",\n        \"Patio\",\n        \"Bosrijke kavel\",\n        \"Duurzaam\",\n        \"Energiezuinig\",\n        \"Architectuur\",\n        \"A-frame\",\n        \"Veel glas\",\n        \"Vergezichten\"\n    ],\n    categories: [\n        \"nieuwbouw\",\n        \"verduurzaming\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Prefab houten villa met patios in Bilthoven | Architect Jules Zwijsen\",\n        description: \"Prefab houten villa met strategische patios in Bilthoven. Zero-compromise kwaliteit, duurzaam gekweekt hout, hoge isolatiewaarde en maximale relatie met natuur en vergezichten.\",\n        keywords: [\n            \"prefab houten villa\",\n            \"houten villa Bilthoven\",\n            \"architect Bilthoven\",\n            \"duurzame villa\",\n            \"energiezuinig bouwen\",\n            \"prefab architectuur\",\n            \"villa met patio\",\n            \"wonen in het bos\",\n            \"maatwerk villa\",\n            \"A-frame villa\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-prefan-opbouw.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-prefan-opbouw.jpg\",\n        alt: \"Duurzame houten villa, deels zwart, deels natuurlijk hout, met veel glas voor optimaal contact met vergezichten.\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-prefan-opbouw.jpg\",\n            alt: \"Prefab houten villa in bosrijke omgeving, met grote glasvlakken en contrasterende houten gevels.\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-vergezichten.jpg\",\n            alt: \"Luxe houten designvilla met A-frame dak en strak buitenzwembad in bosrijke omgeving.\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Een strakke interpretatie van wonen in de natuur\",\n            content: \"De prefab houten villa met patios is het resultaat van een zero-compromise visie op kwaliteit en duurzaamheid. Het ontwerp is zorgvuldig ingebed in een bosrijke omgeving en is ontworpen om vanuit elke ruimte een subliem contact te maken met de omliggende vergezichten.\\n\\nDit is geen standaard woning, maar een architectonische creatie die de schoonheid van een unieke plek maximaal benut: transparant waar het moet, beschut waar het mag, en altijd in balans met licht, zicht en privacy.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-prefan-opbouw.jpg\",\n                alt: \"Prefab houten villa met veel glas en een warme, natuurlijke materialisering in bosrijke setting.\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"Architectuur met perfectie\",\n            values: [\n                \"Zero-compromise kwaliteit\",\n                \"Prefab precisie\",\n                \"Duurzaam materiaalgebruik\",\n                \"Maximaal licht, zicht en privacy\",\n                \"Waardevast en toekomstbestendig\"\n            ],\n            roleItems: [\n                \"Ontwerpvisie: strakke interpretatie van wonen in de natuur\",\n                \"Conceptontwikkeling: patios als architectonisch hart\",\n                \"Materialisering: hout, glas en minimalistische afwerkingen\",\n                \"Ruimtelijke strategie: zichtlijnen, privacy en zonorintatie\",\n                \"Duurzaamheidsambitie: energiezuinig en comfortgericht\"\n            ],\n            partners: [\n                {\n                    label: \"Bouwsysteem\",\n                    value: \"Prefab (gecontroleerde fabricage in de fabriek)\"\n                },\n                {\n                    label: \"Materiaal\",\n                    value: \"Duurzaam gekweekt hout (hoofddraagstructuur en schil)\"\n                },\n                {\n                    label: \"Karakter\",\n                    value: \"Boswoning met vergezichten, grote glasvlakken en patios\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"De prefab bouwmethode als strategisch antwoord op kwaliteit\",\n            content: \"Waarom prefab? Omdat de fabriek de enige plek is waar perfectie tot in het kleinste detail gegarandeerd kan worden. De woning wordt in een gecontroleerde omgeving gefabriceerd, waardoor vocht, faalkosten en tijdrovende processen op de bouwplaats worden geminimaliseerd.\\n\\nBelangrijkste voordelen:\\n- Perfecte kwaliteit door gecontroleerde fabricage\\n- Duurzaam materiaalgebruik met verantwoord hout\\n- Hoge isolatiewaarde voor energiezuinig comfort\\n- Snelle realisatie en minder overlast ter plaatse\\n\\nDeze aanpak maakt het mogelijk om elke voeg, elk detail en elke aansluiting te laten voldoen aan de hoogste standaarden die passen bij een luxe architectonische ambitie.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-houten-gevel-keuken-zicht.jpg\",\n                alt: \"Detail van houten gevel en glaspartij met zicht op keuken en eethoek; warm hout en strakke afwerkingen.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Patios: discrete luxe, privacy en buitenleven in elk seizoen\",\n            content: \"De plattegrond wordt bepaald door strategisch geplaatste patios. Deze buitenruimtes zijn meer dan extras: ze vormen de flexibele overgang van binnen naar buiten en sturen de beleving van privacy, licht en zicht.\\n\\nWat patios toevoegen:\\n- Privacy en beschutting tegen wind en zon\\n- Flexibel gebruik: buitenleven in meerdere seizoenen\\n- Gecontroleerde lichtinval en kadrering van vergezichten\\n\\nAlle woonruimten zijn dankzij de patios en de zonorintatie gepositioneerd om maximaal contact te maken met de omgeving, terwijl beschutting ontstaat waar dat nodig is. Deze doordachte indeling draagt bij aan een waardevaste woning die klaar is voor de toekomst.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-houten-gevel-keuken-zicht-patio-luxe-houten-landhuis.jpg\",\n                alt: \"Buiten lounge patio bij prefab houten woning met zicht op luxe keuken en eethoek door glazen schuifpuien.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"grid\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-vergezichten.jpg\",\n                    alt: \"Luxe houten designvilla met A-frame dak en strak buitenzwembad in bosrijke omgeving.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/a-frame-architectuur-uitkragend-terras-houten-huis-prefab.jpg\",\n                    alt: \"Prefab villa met patio en houten gevelbekleding; interieur en buitenruimte lopen in elkaar over.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-houten-gevel-keuken-zicht-patio-luxe-houten-landhuis.jpg\",\n                    alt: \"Buiten lounge patio met zicht op keuken en eethoek door glazen puien.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/houten-prefab-villa-patio-eethoek.jpg\",\n                    alt: \"Glazen gevel met donker houten planken en een zwevend houten terras bij de patio.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-prefab-villa-zwembad-buitenzicht.jpg\",\n                    alt: \"A-frame villa met patio en glas, geplaatst in een groene, bosrijke omgeving.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-houten-gevel-keuken-zicht.jpg\",\n                    alt: \"Detail van houten gevel en glaspartij met zicht op keuken; warm hout en strakke belijning.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/duurzame-boswoning-met-prefan-opbouw.jpg\",\n                    alt: \"Duurzame houten villa, deels zwart, deels natuurlijk hout, met veel glas en panorama-zicht.\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Een maatwerk oase van licht en hout\",\n            content: \"Het interieur is een verlengstuk van de natuurlijke omgeving. Warm hout, strakke minimalistische afwerkingen en grote glasvlakken zorgen voor maximale lichtinval en een directe relatie met de omliggende bomen.\\n\\nDe open plattegrond stroomt van binnen naar buiten, met de patios als hart van het woonhuis: perfect voor een rustige ochtend, een beschutte lunch of een diner met uitzicht.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/a-frame-architectuur-uitkragend-terras-houten-huis-prefab.jpg\",\n                alt: \"Moderne prefab villa met patio en houten gevelbekleding; zicht op eetruimte met maatwerk tafel.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Klaar voor de toekomst: energiezuinig en levensloopbestendig gedacht\",\n            content: \"Deze woning is ontworpen met oog op de toekomst: energiezuinig, comfortabel en duurzaam. Het gebruik van verantwoord hout en de precisie van prefab bouw zorgen niet alleen voor een minimale ecologische voetafdruk, maar ook voor een hoogwaardig binnenklimaat.\\n\\nSlimme techniek en een doordachte opzet maken de villa tot een duurzame plek om te leven, met een vanzelfsprekende rust en kwaliteit die lang meegaat.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-prefab-villa-zwembad-buitenzicht.jpg\",\n                alt: \"Moderne A-frame prefab designvilla met overdekte patio en glazen gevel in groene omgeving.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Klaar om ook aan de slag te gaan?\",\n        headline: \"Maak kennis met onze aanpak en ontdek wat we voor uw woonplannen kunnen betekenen.\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/prefab-houten-villa-met-patios-bilthoven.ts\n");

