eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   rigoureuzeFaceliftRietkapvillaBreukelenVechtstreek: () => (/* binding */ rigoureuzeFaceliftRietkapvillaBreukelenVechtstreek)\n/* harmony export */ });\nconst rigoureuzeFaceliftRietkapvillaBreukelenVechtstreek = {\n    slug: \"rigoureuze-facelift-rietkapvilla-breukelen-vechtstreek\",\n    title: \"Rigoureuze facelift rietkapvilla\",\n    subtitle: \"Van introvert naar extravert: een traditionele villa getransformeerd naar een luxe landhuis met markante dwarskap, panoramische noordgevel en materiaalharmonie.\",\n    locationLabel: \"Locatie: Breukelen vechtstreek\",\n    tags: [\n        \"Facelift\",\n        \"Rietkapvilla\",\n        \"Luxe landhuis\",\n        \"Dwarskap\",\n        \"Panoramische pui\",\n        \"Kelderoplossing\",\n        \"Verduurzaming\",\n        \"Renovatie\",\n        \"Transformatie\",\n        \"Vechtstreek\"\n    ],\n    categories: [\n        \"verbouw\",\n        \"verduurzaming\",\n        \"uitgelicht\"\n    ],\n    seo: {\n        title: \"Rigoureuze facelift rietkapvilla in Breukelen | Architect Jules Zwijsen\",\n        description: \"Rigoureuze facelift van een rietkapvilla in de Vechtstreek: markante dwarskap, extra ruimte op de verdieping, panoramische noordgevel en een luxe landhuis-uitstraling met duurzaam comfort.\",\n        keywords: [\n            \"rietkapvilla facelift\",\n            \"architect Breukelen\",\n            \"architect Vechtstreek\",\n            \"luxe landhuis renovatie\",\n            \"dwarskap\",\n            \"panoramische pui\",\n            \"renovatie villa\",\n            \"verduurzaming bestaande woning\",\n            \"waardevaste woning\",\n            \"kelderoplossingen\"\n        ],\n        ogImage: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-architectenbureau-rietkapvilla-facelift-riet-hout-glas.jpg\"\n    },\n    featuredImage: {\n        url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-architectenbureau-rietkapvilla-facelift-riet-hout-glas.jpg\",\n        alt: \"Rigoureuze facelift van rietkapvilla met riet, hout en glas; luxe landhuis uitstraling in de Vechtstreek.\"\n    },\n    heroImages: [\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-architectenbureau-rietkapvilla-facelift-riet-hout-glas.jpg\",\n            alt: \"Voorgevel rietkapvilla na facelift: luxe uitstraling met rieten kap, houten accenten en grote glaspartijen.\"\n        },\n        {\n            url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-rigoureuze-facelift-rietkapvilla-noordgevel-uitzicht.jpg\",\n            alt: \"Noordgevel met indrukwekkende glazen pui en uitzicht over de weilanden; constant licht zonder oververhitting.\"\n        }\n    ],\n    sections: [\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Van introvert naar extravert\",\n            content: \"Een rigoureuze facelift met n doel: een bestaande, introverte villa transformeren naar een luxe landhuis met een helder nieuw gezicht. Door de ingrepen te concentreren op kapvorm, gevelopeningen en materialisering ontstond een woning die zich opener, royaler en vanzelfsprekender tot het landschap verhoudt.\\n\\nDe opgave was dubbel: herkenbaarheid en allure aan de entree versterken n tegelijk functionele meters toevoegen, zonder het karakter te verliezen.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-architectenbureau-rietkapvilla-facelift-riet-hout-glas.jpg\",\n                alt: \"Rietkapvilla facelift met luxe materialisering in riet, hout en glas; vernieuwde uitstraling aan de voorzijde.\"\n            }\n        },\n        {\n            type: \"role\",\n            title: \"Projectcontext\",\n            origin: \"Van introvert naar extravert\",\n            values: [\n                \"Rigoureuze transformatie met behoud van karakter\",\n                \"Nieuwe herkenbaarheid van entree en compositie\",\n                \"Ruimtewinst door kap- en volume-ingrepen\",\n                \"Panoramisch wonen met constant noorderlicht\",\n                \"Waardevast, comfortabel en toekomstgericht\"\n            ],\n            roleItems: [\n                \"Ontwerpstrategie: facelift als totaalcompositie (kap, gevel, zichtlijnen)\",\n                \"Entree-architectuur: markant nieuw gezicht door dwarskap\",\n                \"Ruimtelijke upgrade: extra meters op verdieping door kapaanpassing\",\n                \"Gevelconcept: noordgevel met grote pui voor licht en landschap\",\n                \"Interieurstructuur: open plattegrond, maatwerk, duidelijke zones\",\n                \"Flexibiliteit: voorbereiding op afzonderlijke entree/leefruimte (aanleunwoning)\"\n            ],\n            partners: [\n                {\n                    label: \"Ingreep\",\n                    value: \"Facelift / transformatie bestaande villa\"\n                },\n                {\n                    label: \"Architectonisch thema\",\n                    value: \"Dwarskap + open noordgevel als ruimte- en identiteitsmaker\"\n                },\n                {\n                    label: \"Materialisering\",\n                    value: \"Riet, hout en glas met maatwerk interieurafwerking\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"De transversale dwarskap als ruimtewinner\",\n            content: \"De uitdaging was om zowel de herkenbaarheid van de entree te vergroten als functionele meters toe te voegen. De strategische oplossing was de introductie van een markante dwarskap.\\n\\nBelangrijkste effecten:\\n- Een duidelijk gemarkeerde entree die de woning een krachtig nieuw gezicht geeft\\n- Directe ruimtewinst op de verdieping door een slimme aanpassing van de kapconstructie\\n- Een ingreep waarbij esthetiek en woongenot consequent samen optrekken\\n\\nDoor de kap als architectonisch instrument te gebruiken, ontstaat een luxere proportie n een functioneel betere woningindeling.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-facelift-rietkapvilla-ontwerp-dwarskap-extra-ruimte.jpg\",\n                alt: \"Ontwerp dwarskap bij rietkapvilla: markante entree en extra ruimte op de verdieping door kapaanpassing.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Techniek & functionaliteit: panoramisch wonen op het noorden\",\n            content: \"De noordgevel is voorzien van een indrukwekkende glazen pui die een technisch hoogstandje vormt. De pui brengt prachtig, constant licht diep in de woning zonder de hitte van direct zonlicht.\\n\\nHierdoor komt het uitzicht over de weilanden op zowel de begane grond als de bovenverdieping maximaal tot zijn recht. De combinatie van moderne detailoplossingen, waardevaste principes en doordachte kelderoplossingen draagt bij aan een duurzaam en toekomstbestendig resultaat.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-rigoureuze-facelift-rietkapvilla-noordgevel-uitzicht.jpg\",\n                alt: \"Noordgevel met grote glazen pui: diep daglicht en maximaal uitzicht over de weilanden, zonder directe zonwarmte.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"gallery\",\n            layout: \"grid\",\n            gallery: [\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/luxe-architectenbureau-rietkapvilla-facelift-riet-hout-glas.jpg\",\n                    alt: \"Voorgevel na facelift: riet, hout en glas in een luxe landhuis compositie.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-rigoureuze-facelift-rietkapvilla-noordgevel-uitzicht.jpg\",\n                    alt: \"Noordgevel met glazen pui: constant licht en panoramisch uitzicht over de weilanden.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-facelift-rietkapvilla-ontwerp-dwarskap-extra-ruimte.jpg\",\n                    alt: \"Dwarskap als entree-anker en ruimtewinner op de verdieping.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-rigoureuze-facelift-rietkapvilla-open-gevel-zon-contact.jpg\",\n                    alt: \"Gevelopening en zon-contact: meer transparantie en betere relatie met buiten.\"\n                },\n                {\n                    url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/aw1t12.jpg\",\n                    alt: \"Interieur: maatwerk, licht en materialisering afgestemd op de nieuwe kaplijnen.\"\n                }\n            ]\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-left\",\n            fullWidth: false,\n            title: \"Interieur & materiaalharmonie: een maatwerk oase van licht\",\n            content: \"Binnen is de beleving getransformeerd door een open plattegrond en maximale lichtinval. Het maatwerk interieur volgt de lijnen van de nieuwe rieten kap, terwijl natuurlijke materialen de verbinding met de omliggende natuur versterken.\\n\\nDe indeling is ontworpen als een samenspel van zichtlijnen en contactmomenten, met tegelijkertijd een heldere scheiding die een afzonderlijke entree en leefruimte voor een aanleunwoning mogelijk maakt. Daarmee is de woning niet alleen luxer en ruimer, maar ook flexibeler in de tijd.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/aw1t12.jpg\",\n                alt: \"Interieurbeeld na transformatie: maatwerk, veel licht en een ruimtelijke indeling die de kaplijnen volgt.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        },\n        {\n            type: \"split\",\n            layout: \"image-right\",\n            fullWidth: false,\n            title: \"Duurzaamheid: klaar voor de toekomst\",\n            content: \"Door de schil van de woning rigoureus aan te pakken en te moderniseren, is het resultaat niet alleen esthetisch vernieuwend maar ook energiezuinig en comfortabel.\\n\\nDit project laat zien hoe een rietkapvilla de perfecte balans kan vinden tussen bestaand karakter en moderne eisen. Een woning die vandaag overtuigt, en in de komende decennia een waardevaste investering blijft in woongenot en esthetiek.\",\n            image: {\n                url: \"https://www.zwijsen.net/wp-content/uploads/2025/12/architect-rigoureuze-facelift-rietkapvilla-open-gevel-zon-contact.jpg\",\n                alt: \"Open gevel en nieuw contact met zon en landschap; facelift gericht op comfort, energiezuinigheid en beleving.\"\n            }\n        },\n        {\n            type: \"spacer\",\n            size: \"md\"\n        }\n    ],\n    cta: {\n        kicker: \"Realiseer uw eigen architectuur\",\n        headline: \"Vraag een vrijblijvend vooroverleg aan en start de ontwikkeling van uw unieke nieuwe thuis.\",\n        buttonLabel: \"Plan een Gratis Sessie\",\n        href: \"/contact\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/projecten/rigoureuze-facelift-rietkapvilla-breukelen-vechtstreek.ts\n");

