eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   WERKWIJZE_CONTENT: () => (/* binding */ WERKWIJZE_CONTENT)\n/* harmony export */ });\n// Werkwijze pagina content\n// Alle teksten voor de Werkwijze pagina gecentraliseerd\nconst WERKWIJZE_CONTENT = {\n    // Hero sectie\n    hero: {\n        label: \"Werkwijze\",\n        title: \"Van schets tot sleuteloverdracht\",\n        subtitle: \"Helder proces, persoonlijke begeleiding en volledige transparantie\"\n    },\n    // Intro sectie\n    intro: {\n        label: \"Onze Werkwijze\",\n        title: \"Helder proces, persoonlijk contact\",\n        text: \"Veel opdrachtgevers vragen zich af: hoe werkt een architect eigenlijk in de praktijk? Het ontwerpen en bouwen van een woning is een intensief en persoonlijk proces. Het gaat om grote investeringen en langdurige samenwerking. Daarom is het belangrijk dat er vertrouwen is en dat het proces helder en overzichtelijk verloopt.\"\n    },\n    // Belangrijke inzichten sectie\n    insights: {\n        label: \"Belangrijk om te weten\",\n        title: \"Voorkomen is beter dan genezen\",\n        cards: [\n            {\n                icon: \"\",\n                iconColor: \"red-600\",\n                title: \"Waar het vaak misgaat\",\n                paragraphs: [\n                    \"Veel problemen tijdens de bouw ontstaan niet op de bouwplaats, maar al in de ontwerpfase. Onduidelijke keuzes, onvoldoende afstemming met regelgeving of te laat inzicht in kosten kunnen later grote gevolgen hebben.\",\n                    \"Door in een vroeg stadium de juiste vragen te stellen en consequenties te overzien, voorkomen wij verrassingen tijdens uitvoering.\",\n                    \"Dat geeft rust, overzicht en een beter eindresultaat.\"\n                ]\n            },\n            {\n                icon: \"\",\n                iconColor: \"amber-600\",\n                title: \"Herkent u dit?\",\n                paragraphs: [\n                    \"Veel particuliere opdrachtgevers hebben drie zorgen: onverwachte kosten, onomkeerbare fouten en stress tijdens de bouw.\",\n                    \"Ons proces is erop gericht om juist die punten vroeg te ondervangen  met heldere keuzes, goede voorbereiding en duidelijke documenten.\",\n                    \"Zo ontstaat vertrouwen en voorspelbaarheid gedurende het hele traject.\"\n                ]\n            }\n        ]\n    },\n    // Waarom werken met een architect\n    why: {\n        label: \"De Meerwaarde\",\n        title: \"Waarom werken met een architect?\",\n        text: [\n            \"Een architect helpt om uw wensen, dromen en randvoorwaarden te vertalen naar een samenhangend ontwerp. Anders dan bij standaardwoningen wordt bij maatwerk elk aspect afgestemd op de locatie en de bewoners. Licht, zichtlijnen, privacy, bezonning en ruimtelijke relaties spelen daarbij een centrale rol.\",\n            \"Juist die samenhang maakt het verschil tussen een huis en een thuis.\"\n        ],\n        benefits: [\n            {\n                title: \"Uniek ontwerp\",\n                description: \"Maatwerk voor uw situatie\"\n            },\n            {\n                title: \"Locatie-specifiek\",\n                description: \"Optimaal gebruik van kavel\"\n            },\n            {\n                title: \"Persoonlijk\",\n                description: \"Direct contact met architect\"\n            },\n            {\n                title: \"Kwaliteit\",\n                description: \"Toezicht tijdens bouw\"\n            }\n        ]\n    },\n    // Voorbereiding sectie\n    preparation: {\n        label: \"De Basis\",\n        title: \"Voorbereiding: een goede start\",\n        subtitle: \"Een goed ontwerp begint met een goede voorbereiding. Daarbij kijken wij altijd naar drie basiselementen:\",\n        elements: [\n            {\n                title: \"Wensen\",\n                description: \"Praktische wensen zoals indeling en aantal kamers, maar ook minder tastbare aspecten zoals sfeer, licht, rust en privacy.\"\n            },\n            {\n                title: \"Locatie\",\n                description: \"Elke locatie is uniek. Uitzicht, zon, wind, buren, geluid, regelgeving en welstand zijn bepalend voor de juiste positionering en vorm van de woning.\"\n            },\n            {\n                title: \"Budget\",\n                description: \"Helderheid over financile ruimte voorkomt teleurstellingen. Samen bepalen we wat binnen het budget valt en waar prioriteiten liggen.\"\n            }\n        ]\n    },\n    // Kennismaking sectie\n    firstMeeting: {\n        label: \"De Start\",\n        title: \"Kennismaking en eerste schets\",\n        text: \"Na een eerste kennismaking en locatiebezoek maken wij een eerste schets of ontwerpidee. Dit is gebaseerd op de wensen, de locatie en het budget. Deze schets wordt helder toegelicht en vormt de basis om te bepalen of een verdere samenwerking passend is.\"\n    },\n    // Processtappen sectie\n    processSteps: {\n        label: \"Het Ontwerpproces\",\n        title: \"Van ontwerp tot uitvoering\",\n        subtitle: \"Het complete traject in 7 gestructureerde fases\"\n    },\n    // Fase 7 uitgebreid (oplevering)\n    delivery: {\n        badge: \"FASE 07\",\n        title: \"Oplevering & Nazorg\",\n        subtitle: \"Uw droom gerealiseerd  tot in het kleinste detail\",\n        intro: [\n            \"De oplevering is het hoogtepunt van het hele traject. Samen lopen we door uw nieuwe woning en controleren we elk detail. Van de afwerking van kozijnen tot de werking van installaties  alles moet perfect zijn.\",\n            \"Bij de eindoplevering gaan we systematisch door de woning heen. Eventuele kleine onvolkomenheden worden genoteerd en door de aannemer hersteld. Pas wanneer alles aan de hoogste standaard voldoet, vindt de officile sleuteloverdracht plaats.\",\n            \"Een resultaat waar u jarenlang trots op mag zijn  en waar u elke dag opnieuw van geniet.\"\n        ],\n        deliverables: {\n            title: \"Oplevering\",\n            subtitle: \"Het eindresultaat\",\n            items: [\n                \"Gezamenlijke eindoplevering met volledige checklist\",\n                \"Controle op afwerking en detaillering\",\n                \"Test van alle installaties en voorzieningen\",\n                \"Documentatie van gebruiksaanwijzingen en garanties\",\n                \"Officile sleuteloverdracht\"\n            ]\n        },\n        aftercare: {\n            title: \"Nazorg & Garantie\",\n            text: \"Ook na de oplevering blijf ik beschikbaar voor vragen. Kleine kinderziektes worden opgelost en tijdens de garantieperiode blijf ik aanspreekpunt tussen u en de aannemer.\",\n            warranty: \"Garantieperiode: volgens bouwbesluit en aannemersovereenkomst\"\n        }\n    },\n    // Heldere afspraken\n    transparency: {\n        label: \"Transparantie\",\n        title: \"Heldere afspraken\",\n        text: \"Voor de architectenwerkzaamheden maken wij duidelijke afspraken, vastgelegd in een overeenkomst gebaseerd op de Consumentenregeling Architect. Zo weet u vooraf waar u aan toe bent.\",\n        contract: {\n            title: \"Consumentenregeling Architect\",\n            items: [\n                \"Duidelijke fasering en honorarium\",\n                \"Rechten en plichten vastgelegd\",\n                \"Wettelijk beschermd contract\",\n                \"Transparante kostenbewaking\"\n            ]\n        }\n    },\n    // CTA sectie\n    cta: {\n        title: \"Wilt u weten hoe dit proces er voor uw project uitzicht?\",\n        subtitle: \"Vraag een gratis quickscan aan of plan een vrijblijvende kennismaking\"\n    }\n};\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(ssr)/./data/werkwijze.ts\n");

